import React, { useState } from 'react';
import {
  Box,
  Flex,
  Grid,
  Heading,
  IconButton,
  Tab,
  TabList,
  TabPanel,
  TabPanels,
  Tabs,
  useColorModeValue,
  VStack,
  HStack,
  Text,
  Icon,
} from '@chakra-ui/react';
import { FiActivity, FiSettings, FiPieChart, FiMap } from 'react-icons/fi';
import ThreatMap from "../components/dashboard/ThreatMap";
import SecurityScore from "../components/dashboard/SecurityScore";
import RecentAlerts from "../components/dashboard/RecentAlerts";
import AnalyticsDashboard from "../components/analytics/AnalyticsDashboard";
import Settings from "../components/settings/Settings";

const Dashboard = () => {
  return (
    <Box>
      <Heading mb={6}>Security Dashboard</Heading>
      
      <SimpleGrid columns={{ base: 1, md: 3 }} spacing={6} mb={8}>
        <Stat>
          <StatLabel>Security Score</StatLabel>
          <StatNumber>85/100</StatNumber>
        </Stat>
        <Stat>
          <StatLabel>Active Threats</StatLabel>
          <StatNumber>3</StatNumber>
        </Stat>
        <Stat>
          <StatLabel>Employee Training Score</StatLabel>
          <StatNumber>78%</StatNumber>
        </Stat>
      </SimpleGrid>

      <Grid templateColumns="repeat(2, 1fr)" gap={6}>
        <ThreatMap />
        <RecentAlerts />
      </Grid>
      
      <SecurityScore />
    </Box>
  );
};

export default Dashboard;
